import React from "react";


function App(){
  return(
    <>
      <div className="w-1/2 min-h-[100px] flex flex-col">
        <div><h1>TODO LIST</h1></div>
        <div>
          <input placeholder="Add Your New Todo"></input>
          <div>
            <h1 className="bg-white">+</h1>
          </div>
        </div>
      </div>
      
    </>
  )
}

export default App;
